import { BrowserRouter, Routes, Route } from 'react-router-dom'

// Import pages and components
import Home from './pages/Home'
import Navbar from './components/Navbar';
import Login from './pages/Login';

function App() {
  return (
    <div className='App'> 
      <BrowserRouter>
        <Navbar />
        <div className='pages'>
          <Routes>
            <Route 
              path='/'
              element={<Home />}
            />
          </Routes>
          <Routes>
            <Route 
              path='/login'
              element={<Login />}
            />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
